import * as React from 'react';
import { View } from 'react-native';
import { useState, useEffect } from 'react'
import { Loading } from 'aws-amplify-react-native/dist/Auth';
import { LoadingCardViewStyles as styles } from './Styles.js'
import { Platform } from 'react-native'

const isWeb = (Platform.OS == 'web')

function LoadingCardsView()
{
  return(
    <View>
      <LoadingCard showAnimation={isWeb} showBanner={true}/>
      <LoadingCard showAnimation={isWeb} showBanner={true}/>
      <LoadingCard showAnimation={isWeb} showBanner={true}/>
    </View>
  )
}

function LoadingCard({showAnimation, showBanner, extraStyle={}})
{
  return(
    <View style={{...styles.background, ...extraStyle}}>
        {(showBanner)&&
          <View style={{ ...styles.bottomBanner }} />
        }
    </View>
  )
}



export { LoadingCardsView, LoadingCard };
